import { useSelector } from 'react-redux'

export default function Main() {

  const {state} = useSelector(state=>state);
  //console.log(state);
  return (
    <div>
        {
            state.todo && state.todo.map((ele, idx)=>
                (
                    <div>
                        <h1></h1>
                    </div>
                )
            )
        }
    </div>
  )
}
